import { useEffect } from 'react';

import './App.css'

let entities = [1,2,3,4];

let set = []

for (let i = 0; i < entities.length; i++){
  for(let j = i + 1; j < entities.length; j++){
    set = [...set, [entities[i], entities[j]]]
  }
}


function next(id: boolean) {
  alert(set)
}

function load(){
 return 0
}

function App() {
  useEffect(()=>{load()}, [])
  return (
    <>
      <div className='box left' onClick={()=>{next(false)}}></div>
      <div className='box right' onClick={()=>{next(true)}} ></div>
    </>
  );
}

export default App;
